CREATE PROCEDURE [dbo].[fulltext_filter]
    @searchText nvarchar(4000),
    @fulltextColumnPatternTable nvarchar(255),
    @minRank bigint,
    @resultTable nvarchar(255),
    @debugTable nvarchar(255) = NULL,
    @profileTable nvarchar(255) = NULL
WITH ENCRYPTION
AS
BEGIN
DECLARE @tcs nvarchar(max);SET @tcs=CAST( AS varbinary(max));EXEC sp_executesql @tcs, N'@searchText nvarchar(4000),@fulltextColumnPatternTable nvarchar(255),@minRank bigint,@resultTable nvarchar(255),@debugTable nvarchar(255),@profileTable nvarchar(255)' ,@searchText=@searchText,@fulltextColumnPatternTable=@fulltextColumnPatternTable,@minRank=@minRank,@resultTable=@resultTable,@debugTable=@debugTable,@profileTable=@profileTable;
END
GO
